func Test_menuRepo_CreateBatch(t *testing.T) {
	slic := make([]menu.Mu, 0)
	menus := make([]*model.Menu, len(slic))
	err := jsoniter.Unmarshal([]byte(js), &slic)
	if err != nil {
		t.Fatal(err)
	}
	for _, s := range slic {
		marshal, _ := jsoniter.Marshal(s)
		menus = append(menus, &model.Menu{
			//Belong: 2,
			Value: string(marshal),
		})
	}
	repo := NewMenuRepo(get())
	t.Log(repo.CreateBatch(context.TODO(), menus))
}
func get() *gorm.DB {
	DB, err := gorm.Open(mysql.Open(fmt.Sprintf("%s:%s@(%s:%d)/%s?charset=utf8mb4&parseTime=true",
		"root",
		"***",
		"10.4.109.234",
		3330,
		"af_configuration")))
	if err != nil {
		log.Println("open mysql failed,err:", err)
		return nil
	}
	return DB
}

